import React from "react";

import { Container } from "./styles";

export function Product() {
  return (
    <Container>
      <Row>
        <a href="#">Compartilhar</a>
        <a href="#">Vender um igual</a>
      </Row>

      <Panel>
        <Column>
          <Gallery>
            <img src={tshirtImage} alt="T-shirt" />
          </Gallery>
        </Column>
        <Column></Column>
      </Panel>
    </Container>
  );
}
